import React from "react";
import { BaseElemetPropsType } from "../../../UI/BaseElemetPropsType";
export type treeLinkType = BaseElemetPropsType & { href: string };

export default function TreeLink(props: treeLinkType) {
	return (
		<a {...props} className="tree-link">
			{props.title}
		</a>
	);
}
